import React from "react";
import { motion } from "framer-motion";

export default function Welcome() {
  return (
    <div style={{ display: "flex", alignItems: "center", justifyContent: "center", height: "80vh", flexDirection: "column" }}>
      <motion.h1 initial={{ y: -50, opacity: 0 }} animate={{ y: 0, opacity: 1 }} transition={{ duration: 0.7 }}>
        Bienvenido al sistema de registro de estudiantes
      </motion.h1>
      <motion.p initial={{ opacity: 0 }} animate={{ opacity: 1 }} transition={{ delay: 0.5 }}>
        Haz click en "Sistema Estudiantes" para empezar.
      </motion.p>
    </div>
  );
}
